import React, { Component } from 'react';
import './App.css';
import Header from './components/Header';
import Post from './components/Post';

class App extends Component {
  render() {
    return <div className="App">
        <Header />
        <section className="App-main">
          <Post nickname="Bill Portões" avatar="https://pbs.twimg.com/profile_images/988775660163252226/XpgonN0X_400x400.jpg" caption="Look the new Windows 10!!" image="https://t.tudocdn.net/319163?w=646&h=284" />
          <Post nickname="OG" avatar="https://pbs.twimg.com/profile_images/988775660163252226/XpgonN0X_400x400.jpg" caption="Holding a mic" image="https://pbs.twimg.com/media/DOXI0IEXkAAkokm.jpg" />

          {/* more posts */}
          <button>Atualizar</button>
          <button>Postar</button>
        </section>

      </div>;
  }
}

export default App;
